import React from "react";
import axios from "axios";

export const getTaxonomyfromAPI = () => {
  let res = { data: [], status: 200 };
  axios
    .get(
      "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
    )
    .then((response) => {
      res.data = [...response.data];
      res.status = 200;
    })
    .catch((error) => {});
  return res;
};
